import React from 'react'
import TradingViewWidget, { Themes } from 'react-tradingview-widget';

export default function TradingThree() {

const Trading = new TradingViewWidget

let small = Trading.width = '600px'
let themey = Trading.theme = 'Dark'
let indicators =  Trading.studies = [ "Volume@tv-basicstudies", "StochasticRSI@tv-basicstudies",  "MASimple@tv-basicstudies"]

// console.log(Trading)
// console.log(typeof Trading)
// console.log(Trading.width)
// console.log(indicators[0])



return (
<div>

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme={themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={small}
    height='280px'
    style='8'
    interval="180"
    studies={indicators}

/>


<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={small}
    height='280px'
    style='8'
    interval="180"
    studies={indicators}           
  />

<TradingViewWidget
    symbol="BITSTAMP:LTCUSD"
    theme= {themey}
    // theme={Themes.DARK}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={small}
    height='280px'
    style='8'
    interval="180"
    studies={indicators}         
  />

</div>
)
}
